import { changePath } from '../store';
import { useSelector, useDispatch } from 'react-redux';
import { changeLoginInput } from '../store';
import { logInPath } from '../store/slices/navigationSlice';

function ApplicantLogin()
{
    const dispatch = useDispatch();
    const loginInput = useSelector((state) =>
    {
        return state.login.loginInput;
    })
    const handleLoginInputChange = (event)=>
    {
        dispatch(changeLoginInput(event.target.value));
    }
    const handleSubmit = (event) =>
    {
        event.preventDefault();
        dispatch(changePath(LOGIN_PATH));
    }

    return <div>
    <form onSubmit={handleSubmit} className="car-form panel">
        <div className='field-group'>
            <div className='field'>
                <label className='label'>Email: </label>
                <input 
                    className="input is-xpanded"
                    value={loginInput}
                    onChange={handleLoginInputChange}
                ></input>
            </div>
        </div>
        <div className="field">
            <button className="is-link">Login</button>
        </div>
    </form>
    </div>
}

export default ApplicantLogin;
